import React from 'react';
import { useHistory } from 'react-router-dom';
import './NavBar.css'


export default function NavBar() {
  const history = useHistory();

  const handleClickSort = () => {
    history.push('/');
  }
  const handleClickPath = () => {
    history.push('/pathfinding');
  }

  return (
    <nav id='navbar'>

      <button>
        Sorting
        </button>

      <button>
        Pathfinding
        </button>

    </nav>
  )
}
